import { RadioGroup, RadioButton } from "react-radio-buttons";

function Filter() {
  const position = {
    container: "w-2/5 *:pb-4",
  };
  return (
    <div className={position.container}>
      <Price />
      <Discount />
      <Color />
      <Size />
    </div>
  );
}

export default Filter;

// Sub-components

function Price() {
  const position = {
    inputwrapper: "flex gap-2 items-center",
  };
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Price</h4>
      <RadioGroup>
        <RadioButton value="0-1000">0-1000</RadioButton>
        <RadioButton value="1000-2000">1000-2000</RadioButton>
        <RadioButton value="2000-3000">2000-3000</RadioButton>
      </RadioGroup>
    </div>
  );
}

function Discount() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Discount</h4>
    </div>
  );
}

function Color() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Color</h4>
    </div>
  );
}

function Size() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <div>
      <h4 className={design.heading}>Size</h4>
    </div>
  );
}
